  KEY `idx1` (`user_id`,`type`,`create_time_ymd`),
  KEY `idx2` (`user_id`,`type`),
  KEY `create_time_ymd` (`create_time_ymd`),
  KEY `idx3` (`type`,`create_time`)
) ENGINE=MyISAM AUTO_INCREMENT=1881 DEFAULT CHARSET=utf8 COMMENT='会员资金日志表';
